/* global google */
import React, { useEffect } from 'react';

const MapComponent = () => {
  useEffect(() => {
    window.initializeMap = initializeMap; // Define initializeMap en el contexto global
    loadGoogleMaps();
  }, []);

  const loadGoogleMaps = () => {
    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyBomnY9UemevV5IVEXtYHP6SWw3kRsERGc&libraries=marker&callback=initializeMap`;
    script.async = true;
    script.defer = true;
    document.body.appendChild(script);
  };

  const initializeMap = () => {
    const mapElement = document.getElementById('map');
    const map = new google.maps.Map(mapElement, {
      center: { lat: -34.397, lng: 150.644 },
      zoom: 8,
    });

    // Ejemplo de agregar un marcador
    const marker = new google.maps.Marker({
      position: { lat: -34.397, lng: 150.644 },
      map: map,
      title: '¡Hola mundo!',
    });
  };

  return (
    <div>
      <h1>Mi Mapa</h1>
      <div id="map" style={{ height: '500px', width: '100%' }}></div>
    </div>
  );
};

export default MapComponent;
